import React from 'react';
import {BrowserRouter as Router, Route, Link, Routes} from 'react-router-dom';

function Nav() {

  return (
    <Router>
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
        </ul>
      </nav>
    </div>
  </Router>
  )
}

export default Nav;
